var tipuesearch = {"pages": [{'title': 'About', 'text': '我的倉儲網址: https://github.com/409231044/cd2022 \n \n', 'tags': '', 'url': 'About.html'}, {'title': 'NX1980', 'text': '小組分組影片 \n 我被分配到第31-36的影片 \n \n 31 \n 影片中在教我們如何標註尺寸,以及修改一些固定的限制,接著放入機台中讓機器去跑程式模擬加工過程 \n 參考影片: https://youtu.be/31 \n \n 32 參考影片: https://youtu.be/32 \n \n 33 參考影片: https://youtu.be/33 \n \n 34 參考影片: https://youtu.be/34 \n \n 35 參考影片: https://youtu.be/35 \n \n 36 參考影片: https://youtu.be/36 \n \n \n', 'tags': '', 'url': 'NX1980.html'}, {'title': '每周任務', 'text': '', 'tags': '', 'url': '每周任務.html'}, {'title': 'w6', 'text': 'w6的任務是將自己網站的資料建w6網誌 \n \n \n \n', 'tags': '', 'url': 'w6.html'}, {'title': 'w7', 'text': '程式要打的內容: \n \n git clone \xa0 https://github.com/mdecourse/scarysim.git \n 修改 scarysim.pro, 蓋掉第 11 行, 成為 # LIBS\xa0\xa0\xa0\xa0 += -lglut -lGLU \n cd scarysim \n qmake -o Makefile scarysim.pro \n mingw32-make -f Makefile.Release 可以在 release 目錄取得 scarysim.exe \n 因為 scarysim.exe 執行需要 base.obj, arm1.obj, arm2.obj, arm3.obj 等零件外型檔案, 以及對應的 .mtl 材質檔案, 因此可將 scarysim.exe 移至倉儲根目錄執行. \n \n \n \n \n \n 之後要開啟程式要按 \n 以下 \n \n \n 點開就可以開始小的模擬畫圓 \n \n', 'tags': '', 'url': 'w7.html'}, {'title': 'w8', 'text': 'uarm 各零件工程圖 \n 我是用onshape畫以下零件的工程圖 \n \n / 鋁支撐柱 / \n \n \n \n \n / 連桿軸承壓 / \n \n \n / L型連接件 / \n \n \n / 前端零件 / \n \n \n \n / 軸承支撐座 / \n \n \n \n / 鉸鍊 / \n \n \n / 支撐柱 / \n \n \n', 'tags': '', 'url': 'w8.html'}, {'title': 'w10', 'text': '在wink中加入註解 \n \n \n \n \n \n \n', 'tags': '', 'url': 'w10.html'}, {'title': 'w11', 'text': '將token更改為ssh \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'w11.html'}, {'title': 'w12', 'text': '使用NX去計算之前畫過的零件 \n \n \n \n \n \n \n', 'tags': '', 'url': 'w12.html'}, {'title': 'w13', 'text': '開始遠距 \n \n', 'tags': '', 'url': 'w13.html'}, {'title': 'w14', 'text': '將零件檔匯出給老師檢查 \n 使用 MTB_nx robot以鍵盤控制 \n D:吸盤可以向下 U:吸盤可以向上 L:吸盤順時針轉動 \n R:吸盤逆時針轉動 \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'w14.html'}, {'title': 'w15', 'text': 'https://mde.tw/cd2022_guide/content/w15.html \n 要按照老師的網址去做 \n \n', 'tags': '', 'url': 'w15.html'}, {'title': 'w16', 'text': '', 'tags': '', 'url': 'w16.html'}, {'title': 'Online Exam', 'text': '遠距-課堂小考試實際操作畫面 \n \n \n \n \n \n 已知左側綠色底座的 uArm 機械手臂, 其基座座標原點位於絕對座標 (1.0, 0.25, 0), 啟動模擬後 green_suctionpad_frame 座標原點則位於 (0.22859, 0.26047, 0.36576), 請列出運算式說明, 啟動模擬後 joint1, joint2 與 joint3 分別以逆時針旋轉 5 度後, 求 green_suctionpad_frame 的絕對座標值. \n \n \n \n \n \n \n \n \n \n \n 已知左側 uarm 前方的紅色方塊頂端中心座標值為 (0.2, 0.4, 0.1), 請列出運算式說明左側 uarm 機械手臂的 joint1, joint2 與 joint3 該如何旋轉才能讓 end effector 的吸盤末端中心點移動至紅色方塊頂端中心? \n \n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'Online Exam.html'}, {'title': 'w17', 'text': '老師課堂檢查 \n', 'tags': '', 'url': 'w17.html'}, {'title': 'w18', 'text': '老師檢查個人網站,並且有其中考試題目 \n', 'tags': '', 'url': 'w18.html'}, {'title': '期末考周', 'text': '\n 第一題 利用nx12修改 "絞鍊"與 "front joint" 零件的外型, 使能將 "Triangular connecting rod", "left link" 與 "end link" 等零組件, 與 "right crank" 與 "right link" 的組件左右互換 \n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n ------------------------------------------------------------------------------- \n 第二題 將新幾何外型組立的 uArm 機械手臂後, 將組立件轉入 CoppeliaSim 4.3.0 rev3,\xa0以 slider 控制前三軸的轉動 使用NX12繪製及修改零件,接著再轉入 CoppeliaSim進行模擬 心得:因為很少在練習nx,所以在這次的組裝過程中卡有點久,但後來有順利組出來,然而在模擬的部分跟之前課堂操作類似,所以蠻快就可以知道要怎麼做了 接組立件套入程式模擬 \n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n ------------------------------------------------------------------------------- \n 第三題 與同組組員合作,\xa0在 Teams 會議中, 以畫面分享及錄影功能, 由兩位 (含) 以上組員測試題目 2. 的 XML UI slider 控制功能 有開teams錄製內容 ------------------------------------------------------------------------------- 第四題 由兩位 (含) 以上組員協同在新幾何外型組立的 uArm 機械手臂場景中, 加入 suctionPad 零件, 以手動操控或程式操控的方式, 錄製 block 方塊零件的取放模擬影片 ------------------------------------------------------------------------------- 第五題 由兩位 (含) 以上組員協同在新幾何外型組立的 uArm 機械手臂場景中, 以跨網路 Python remote API 的方式, 錄製圖形介面 slider 控制前三軸的轉動影片', 'tags': '', 'url': '期末考周.html'}]};